import React from 'react'
import Button from '../../components/button/Button'
import Form from '../../components/form/Form'
import Input from '../../components/input/Input'

function AddProduct() {
  return (
    <div className='login'>
      <Form title={"İlan Ekle"}>
        <Input
          type={"text"}
          placeholder={"İlan adı"}
        />
        <Input
          type={"password"}
          placeholder={"İlan Detayları"}
        />
        <Input
          type={"text"}
          placeholder={"İlan Resimleri"}
        />
        <Input
          type={"password"}
          placeholder={"Şifre"}
        />
        <Input
          type={"text"}
          placeholder={"Email"}
        />
        <Input
          type={"password"}
          placeholder={"Şifre"}
        />
        <Button />
      </Form>
    </div>
  )
}

export default AddProduct
